import React from 'react';

const Summary = ({ id, user }) => {
    console.log(user);
    return <div></div>;
}

const User = ({ id, page, user }) => {
    console.log(`⭐️ ${id}의 ${page} 페이지의 세부정보 ⭐️`);

    if (page === 'summary') {
        return (
            <Summary
                id={id}
                user={user}
            />
        );
    }

    return <div>Hello</div>
}

export default User;
